import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
  main: {
    backgroundColor: 'white',
  },
  container: {
    backgroundColor: 'lightblue',
  },
  buttons: {
    marginTop: '40px',
  },
  accountInfo: {
    textAlign: 'center',
  }
}))

export default useStyles;
